import React, {Component} from "react";
import BookCard from "./BookCard";
import db from "./db";

export default class BookCards extends Component {
    render() {
        const bookItem = db[0].books[0]
        console.log(bookItem);

        return (
            <BookCard bookCard = {bookItem}>
            </BookCard>
        );
    }

}
